import React, { Component } from 'react';
import { Link, Route, Routes } from 'react-router-dom';
// import desktop from '../../../../../Assets/Images/pcAccesories/desktop.jpg';
import desktop from '../../../../../Assets/Images/pcAccesories/desktop.jpg';
import PcItem from '../../PcItem/PcItem';
import PcItems from '../../PcItems/PcItems';



//manage state here

class PcCategory extends Component {


    render () {

        Object.keys(this.props.data).map(item => {

            let y = `/pc/${item}`;
            console.log(y);

            return <Routes>
                    <Route path={y} element={<PcItem item={item}/>}/>
                </Routes>
        })

        let x = Object.keys(this.props.data).map(item => {
            return <PcItems key={item} category={item}/>
        })

        return (

            <div>
                <h2>Shop By Category</h2>
                <div>
                    {x}
                </div>
            </div>

        )
    }
}

export default PcCategory;
